    String Licencia;
    String Nacionalidad;
    String Sangre;
    bool ExistSelectC = true;
    int MontoP;

    public void AP()
    {
        MontoP = (FIN.Day + 1 - INC.Day) * Convert.ToInt32(Precio);
    }

